//import logo from './logo.svg';
import "./App.css";
import Header from "./components/Header";
//import AddPost from "./components/AddPost";
import Posts from "./components/Posts";
import { Routes, Route } from "react-router-dom";

function App() {
  return (
    <>
      <div className="main">
        <Routes>
          <Route
            path="/"
            element={
              <>
                <Header />
              </>
            }
          />
          <Route
            path="/add"
            element={
              <>
                <Header />
              </>
            }
          />
        </Routes>
      </div>
    </>
  );
}

export default App;
